import {React} from 'react'

const NotesList = (props) => {

    const {title, body} = props

    axios.get('http://dct-user-auth.herokuapp.com/')

    return (
        <div>
            <h2>{title}</h2>
            <h3>{body}</h3>
        </div>
    )
}

export default NotesList
